import React from 'react';
import pokemonList from './pokemon'; // ./ means check the current directory for this file
import './App.css';

function App() {
  return (
    <div>
      <h1>Pokedex</h1>
      {pokemonList.map(pokemon => {
        let caughtText = "Not caught";
        if (pokemon.caught) {
          caughtText = "Caught";
        }

        return <div>{pokemon.name}, {pokemon.type}, {pokemon.caught}</div>
      })}
    </div>
  );
}

export default App;
